import styled from 'styled-components'

const Outer = styled.button`
    display: flex;
    height: 4em;
    flex: 1;
    justify-content: center;
    align-items: center;
    font-weight: lighter;
    font-size: 1.4em;
    background-color: #A9A9A9;
    color: #888;
    outline: 1px solid #888;
`

export default Outer
